        console.log(user);
    }

    function actionAjouter(){
        alert('vous avez ajouté')
    }

    return(
        <div>
            <h1>Nouveau utilisateur</h1>
            <br/>
           <input type="numer" onChange={handleChange}/>
           <br/>
           <button> <Link to='/'>ANULLER</Link></button>
           <button onClick={actionAjouter}>AJOUTER</button>
        </div>
    )
}
